import React from 'react';
import { DeleteModalContent } from './Delete.styled';

interface DeleteNumProps {
  contact: { name: string } | null;
  onDelete: () => void;
  onCancel: () => void;
}

const DeleteNum: React.FC<DeleteNumProps> = ({ contact, onDelete, onCancel }) => {
  if (!contact) return null;

  return (
    <DeleteModalContent>
      <h3>удалить {contact.name}?</h3>
      <button onClick={onDelete}>Да</button>
      <button onClick={onCancel}>Нет</button>
    </DeleteModalContent>
  );
};

export default DeleteNum;
